  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Red Rock
  Lakes National Wildlife Refuge outlines Refuge accomplishments during the 1988 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  management planning, public participation, and research and investigations. Refuge
  administration is outlined; information about personnel, volunteer programs, funding,
  and safety is given. Habitat management is also covered; subjects include wetlands,
  grasslands, grazing, and fire management. The wildlife section of the report discusses
  wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
  waterbirds, game mammals, fisheries resources, animal control, and disease prevention
  and control. The public uses of the Refuge described in this report include hunting,
  fishing, camping, and law enforcement. The equipment and facilities section of the
  report provides information about new construction, rehabilitation, equipment utilization
  and replacement, and communication systems. Field guides are attached.\",\n\t\"owner_org\":
